/*****************************************************************************
 *
 * PubPoint Smart Draw Web application
 *
 * Developed for PubPoint Strategy by Eng. FEUYAN TCHOUO
 *
 * Copyright (C) PubPoint Strategy - All rights reserved.
 * Unauthorized copying of this file, via any medium is strictly prohibited.
 * Proprietary and confidential.
 * Written by FEUYAN TCHOUO <tca1audricfeuyan@gmail.com>, November 2018.
 *
 *****************************************************************************
 */
import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class AuthenticationNavbar extends Component {

  render() {
    return (
      <nav class="navbar navbar-light bg-light justify-content-between">
        <a class="navbar-brand" href="#">
          <img src="images/logoblack.png" width="30" height="30" class="d-inline-block align-top" alt="PubPoint Smart Draw" />
        </a>

        <div>
          <Link class="btn btn-outline-success my-2 my-sm-0" to="/Register">Compte</Link>
          <Link class="btn btn-outline-success my-2 my-sm-0" to="/Login">Connexion</Link>
        </div>
      </nav>
    );
  }

}

export default AuthenticationNavbar;
